import navIcon3 from "../assets/img/nav-icon3.svg";

export const Footer = () => {
  return (
    <div>
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#c4455b" fill-opacity="1" d="M0,128L26.7,154.7C53.3,181,107,235,160,229.3C213.3,224,267,160,320,144C373.3,128,427,160,480,197.3C533.3,235,587,277,640,272C693.3,267,747,213,800,213.3C853.3,213,907,267,960,256C1013.3,245,1067,171,1120,133.3C1173.3,96,1227,96,1280,117.3C1333.3,139,1387,181,1413,202.7L1440,224L1440,320L1413.3,320C1386.7,320,1333,320,1280,320C1226.7,320,1173,320,1120,320C1066.7,320,1013,320,960,320C906.7,320,853,320,800,320C746.7,320,693,320,640,320C586.7,320,533,320,480,320C426.7,320,373,320,320,320C266.7,320,213,320,160,320C106.7,320,53,320,27,320L0,320Z"></path></svg>
      <footer className="footer">
      <Container>
        <Row className="align-items-center">
          <MailchimpForm />
          <Col size={12} sm={6}>
            <img src={logo} alt="Logo" />
